import {useEffect } from "react"


 const SideBarPages = ()=> {

       const route = [
           {
               slug: 'HomePage',
               label: "Admin HomePage",
               component: "nothing yet"
           },
           {
            slug: 'DrivePage',
            label: "Hehhehe",
            component: "nothing yet"
        }
       ]

       const router  = useRouter()
       let currentPath = router.query.pages
       const FindSlugMatchingComp = () => component.find((cmp => {
           return cmp.slug === currentPath
       }))

       useEffect(() => {
         const foundComponent = FindSlugMatchingComp()
       }, [router])


    return (
        <div>
            <h2>{currentPath}</h2>
        </div>
    )
}

export default SideBarPages
